import React from 'react'

const Promesa = ({prods}) => {


    return (
      <div>
      {prods.length > 0 ? (
        prods.map((producto, index) => {
          <>
            <h1 key={index}>{producto.Nombre}</h1>
            <h1 key={index}>{producto.Descripcion}</h1>
            <h1 key={index}>{producto.Boton}</h1>
          </>;
        })
      ) : (
        <h1>Cargando...</h1>
      )}
      </div>
    );
    
        }
  
export default Promesa
